import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Ensure Router is imported from react-router-dom
import { FaEnvelope } from 'react-icons/fa';  // Import the envelope icon

import Login from './components/Login';
import Signup from './components/Signup';
import AdminHome from './components/AdminHome';
import UserHome from './components/UserHome';
import FacultyHome from './components/FacultyHome';
import ForgotPassword from './components/ForgotPassword';
import AboutUs from './components/AboutUs';
import Contact from './components/Contact';
import UserProfile from './components/UserProfile';
import ResourceDetail from './components/ResourceDetail';
import Welcome from './components/Welcome';
import PlacementOpportunities from './components/PlacementOpportunities';
import ResourceDetails from './components/ResourceDetail';
import PlacementMaterials from './components/PlacementMaterials';
import Profile from './components/Profile';
import Assignments from './components/Assignments';
import CertificationCourses from './components/CertificationCourses';
import Payment from './components/Payment';
import PlacementHistory from './components/PlacementHistory';
import Performance from './components/Performance';
import MailComponent from './components/MailComponent';  // Import MailComponent

function App() {
    return (
        <Router> {/* Ensure the Router component is wrapping the Routes and all the code */}
            <div className="app-container">
                {/* Module Card for Mail */}
                <div
                    className="module-card"
                    onClick={() => window.location.href = "/mail"}  // Use window.location.href for navigation
                    style={styles.moduleCard}
                >
                    <FaEnvelope className="module-icon" style={styles.icon} />
                    <p className="module-text" style={styles.moduleText}>Mail</p>
                </div>

                <Routes>
                    <Route path="/" element={<Welcome />} />
                    <Route path="/login" element={<Login />} />
                    <Route path="/signup" element={<Signup />} />
                    <Route path="/admin-home" element={<AdminHome />} />
                    <Route path="/user-home" element={<UserHome />} />
                    <Route path="/resource/:id" element={<ResourceDetail />} />
                    <Route path="/user-profile" element={<UserProfile />} />
                    <Route path="/faculty-home" element={<FacultyHome />} />
                    <Route path="/forgot-password" element={<ForgotPassword />} />
                    <Route path="/about" element={<AboutUs />} />
                    <Route path="/contact" element={<Contact />} />
                    <Route path="/placement-opportunities" element={<PlacementOpportunities />} />
                    <Route path="/resource/:id" element={<ResourceDetails />} />
                    <Route path="/placement-Materials" element={<PlacementMaterials />} />
                    <Route path="/profile" element={<Profile />} />
                    <Route path="/assignments" element={<Assignments />} />
                    <Route path="/certification-courses" element={<CertificationCourses />} />
                    <Route path="/payment" element={<Payment />} />
                    <Route path="/placement-history" element={<PlacementHistory />} />
                    <Route path="/performance" element={<Performance />} />
                    <Route path="/mail" element={<MailComponent />} /> {/* New Route for Mail */}
                </Routes>
            </div>
        </Router>
    );
}

// Styles for the module card
const styles = {
    moduleCard: {
        display: 'flex',
        alignItems: 'center',
        backgroundColor: '#007BFF',
        padding: '15px',
        margin: '10px 0',
        borderRadius: '8px',
        cursor: 'pointer',
        boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
        transition: 'background-color 0.3s ease',
    },
    icon: {
        color: 'white',
        fontSize: '24px',
        marginRight: '15px',
    },
    moduleText: {
        color: 'white',
        fontSize: '18px',
        fontWeight: 'bold',
    },
};

export default App;
